import React from 'react';
import detailsheroimg from "../img/item-4.png";
import { Btn } from './Button';

class CartList extends React.Component {
    render() {
        return (
            <section className='cart-list'>
                <div className='container'>
                    <h4>
                        your cart
                    </h4>
                    <div className='box-cart-list'>
                        <img src={ detailsheroimg } alt="detailsheroimg" />
                        <span>
                            pastel pink t-shirt
                        </span>
                        <span>
                            01
                        </span>
                        <span>
                            $68
                        </span>
                        <Btn classbtn="main-btn-dark-bc" text="check u"/>
                    </div>
                </div>
            </section>
        );
    }
}

export default CartList;
